import React from "react";

const ParkInfo = props => (
      <div>
      {props.name && <p>Park Name: {props.name}</p>}

      {props.fullName && <p>Full Name:{props.fullName}</p>}

      {props.states && <p>State: {props.states}</p>}

      {props.designation && <p>Designation:{props.designation}</p>}

      {props.weatherInfo && <p>Weather: {props.weatherInfo}</p>}

      {props.latLong && <p>Coordinates: {props.latLong}</p>}

      {props.description && <p>Description: {props.description}</p>}

      {props.error && <p>{props.error}</p>}
      </div>
);

export default ParkInfo;
